  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:31.507899\",\n\t\"name\": \"arrowwood-national-wildlife-refuge-narrative-report-calendar-year-1978\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1978 calendar
  year. The report begins by summarizing the weather conditions and water conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments and prescribed fire. Resource
  management is outlined; topics include fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, hunting, and safety. Items of interest
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
